{	
	JObject regularNegativeEvent = new JObject();
	regularNegativeEvent["activityId"] = row["Aktivitets-id"].ToString();
	regularNegativeEvent["citizenId"] = row["Borger-id"].ToString();
	regularNegativeEvent["description"] = row["Begrundelse for partshøring"].ToString();
	regularNegativeEvent["eventTypeCode"] = row["Hændelsestype"].ToString();
	regularNegativeEvent["startDate"] = row["Hændelsesdato"] is DateTime date ? date.ToString("yyyy-MM-ddT22:00:00.000Z") : (string)null;
	regularNegativeEvent["title"] = eventType == "Andet" ? row["Titel"].ToString() : eventType;

	regularNegativeEvents.Add(regularNegativeEvent);
}

